class TopicList extends Component {

    constructor(props) {
        super(props);
        this.state = {
            topics: [],
        };
    }


    componentDidMount() {
        this.fetchQuestions();
    }

    fetchQuestions() {
        this.setState({
            topics: allTopics,
        });
    }

    render() {
        const topicCards = this.state.topics.map(topic =>
            <Card key={topic.id} >
                <Image
                    source={{uri: 'data:image/jpeg;base64,'}}
                    style={{width: 500, height: 200}}
                />
                <Subheader text={topic.title} />
                <Text style={styles.questionText}>
                    {topic.summary}
                </Text>
                <Button
                    raised primary text="LEARN MORE" iconPlacement="right"
                    onPress={() => this.props.navigator.push(routes.topic)}
                />

            </Card>
        );

        return (
            <View style={styles.container}>
                <Toolbar
                    leftElement="arrow-back"
                    onLeftElementPress={() => this.props.navigator.pop()}
                    centerElement={this.props.route.title}
                />
                <ScrollView style={styles.container}>
                    {topicCards}
                </ScrollView>

            </View>
        );
    }
}

TopicList.propTypes = propTypes;
TopicList.contextTypes = contextTypes;

export default TopicList;
